(1, 0, 'performance_accessories', 'performance accessories', 'performance-accessories', '', '', '', '', '', ''),
(2, 0, 'performance_accessories', 'body kits', 'body-kits', '[make] | custom body kits for your [make]', '', '', 'body kits', '<p>There are two main functions served by auto body kits: for function and aesthetic enhancements. Thus, it is one of the most basic tools needed by every car owner to ensure that their vehicle delivers optimum performance. You can find these kits in automotive shops and is essential for the maintenance of your vehicle. For any car enthusiast, it is therefore important that you know about basic components included in the kit so you can utilize them to the fullest. Your ability to utilize fully the kit components is also vital in ensuring that you can provide maximum performance and function.</p>\r\n\r\n<p>The most basic component involves maintaining the exterior parts of the vehicle. You can get separate parts or get the complete bundle so you can produce an entirely new look for your vehicle. This is very true with racers because the exterior parts of the body will also enhance the car&#39;s performance.</p>\r\n\r\n<a rel="example_group" class="img-r" style="margin-right:12px" href="http://www.scienceg8.com/templates/images/body_kits.jpg" title=" Body Kits"><img alt=" Body Kits" src="http://www.scienceg8.com/templates/images/body_kits_prev.jpg"></a>\r\n\r\n<p>Slight enhancements to the exterior and interior components of your vehicle will incrementally boost the performance of the vehicle. You can use the kit to modify various parts of the vehicle, such as the bumpers, grills, roofs, headlights, and spoilers, to name a few. Hence, you can utilize it to achieve optimum automobile performance that will increase the value of your vehicle.  Your ability to invest in a good quality auto body kits will therefore make a difference in the kind of enhancement you can enjoy.</p>\r\n\r\n<p>It is important to note that there is specialized auto body kits sold in the market whether online or offline that are designed for specific car models. Hence, it is best to go for shops that have a wide selection of kits to choose from, regardless of the type of vehicle you are driving. If possible, take the time to look into the basic car components included in the kit so you can assess the quality of the materials. In an online automotive shop, you can determine the quality of the kit by looking at the reputation of the shop itself and the manufacturer.</p>\r\n\r\n<p>It is also important to do a bit of research on car body kits - what are the various components and how to utilize it to the fullest. Thus, you will know how to take advantage of these tools for your own benefit, regardless of what aspect of your vehicle you need improvement on. You may also consult various experts at the shop to get more insight into how to make the most of the body kits for your own benefit. In the end, it will be worth the investment you make. </p>', ''),
